import { Button, SxProps, Theme, Typography, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";
import backgroundImage from './background.avif';
import { useState } from "react";


function AddShops() {

    const[isHovered, setIsHovered] = useState(false);

    const wholeConShops: SxProps<Theme> = {
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        // backgroundImage: `url(${backgroundImage})`,
        backgroundSize: 'cover', 
        backgroundPosition: 'center', 
        minWidth: '800px',
    }

    const headerShops: SxProps<Theme> = {
        display: 'flex',
        justifyContent: 'center',
        fontFamily: 'Times New Roman, Times, serif',
        fontSize: 'x-large',
    }

    const container: SxProps<Theme> = {
        display: 'flex',
        width: '1000px',
        flexDirection: 'column',
        marginTop:'180px',
    }

    const bodyShops: SxProps<Theme> = {
        display: 'flex',
        flexDirection: 'row',
    }

    const body1: SxProps<Theme> = {
        display: 'flex',
        flex: 1,
        alignItems: 'center',
        fontFamily:'timesnewroman',
        fontSize:'18px',
    }

    const body2: SxProps<Theme> = {
        display: 'flex',
        flex: 1,
        alignItems: 'center'
    }

    const shopDetails: SxProps<Theme> = {
        marginTop:'20px',
        marginLeft:'20px',
        fontFamily:'TimesNewRoman',
        display:'flex',
        flexDirection:'column',
    }

    const shopDetailsPart : SxProps<Theme> = {
        display: 'flex',
        flexDirection: 'row',
    }

    const shopDetails1: SxProps<Theme> = {
        display:'flex',
        flex: 1,
        alignItems:'center',
    }

    const shopDetails2: SxProps<Theme> = {
        display:'flex',
        flex:1,
        alignItems:'center',
    }

    const submitButton : SxProps<Theme> = {
        display:'flex',
        justifyContent:'center',
        alignItems:'center',
        minHeight:'10vh'
    }

    return (
        <Box sx={wholeConShops}>
            <Box sx={headerShops}>
                <h2>HERE YOU CAN ADD THE SHOPS</h2>
            </Box>
            <Box sx={container}>
                <Box sx={bodyShops}>
                    <Box sx={body1}><label>ENTER THE SHOP NAME      : </label></Box>
                    <Box sx={body2}><input type='text'></input></Box><br /><br /><br /><br />
                </Box>
                <Box sx={bodyShops}>
                    <Box sx={body1} onMouseEnter = {()=> setIsHovered(true)}  onMouseLeave = {()=> setIsHovered(false)}>ENTER THE SHOPLOCATION :</Box>
                </Box>
                {isHovered && (
                    <Box sx = {shopDetails}onMouseEnter = {()=> setIsHovered(true)}  onMouseLeave = {()=> setIsHovered(false)}>
                        <Box sx = {shopDetailsPart}>
                            <Box sx={shopDetails1}><label>ENTER THE SHOP'S COUNTRY :</label></Box>
                            <Box sx={shopDetails2}><input type='text'></input></Box><br /><br />
                        </Box >
                        <Box sx = {shopDetailsPart}>
                            <Box sx={shopDetails1}><label>ENTER THE SHOP'S STATE :</label></Box>
                            <Box sx={shopDetails2}><input type='text'></input></Box><br /><br />
                        </Box>
                        <Box sx = {shopDetailsPart}>
                            <Box sx={shopDetails1}><label>ENTER THE SHOP'S CITY</label></Box>
                            <Box sx={shopDetails2}><input type='text'></input></Box><br /><br />
                        </Box>
                    </Box>
                )}
                <Box sx = {submitButton}><Button variant="contained">ADD SHOPS</Button></Box>
            </Box>
        </Box>
    )
}
export default AddShops
